CREATE TRIGGER [dbo].[CL_T_AIU_CL_TREATMENT_TREATMENT_STATUS] on dbo.CL_TREATMENT
FOR INSERT, UPDATE
AS 
	IF UPDATE(ACTION_STATUS)
		BEGIN
			DECLARE @COUNT_LOOP INT
			DECLARE @MAX_LOOP UNSIGNED BIGINT

			select @COUNT_LOOP = 1
			select @MAX_LOOP = count(TREATMENT_ID) from inserted 

			--declare variable
			DECLARE @TREATMENT_ID UNSIGNED BIGINT
			DECLARE @ACTION_STATUS SMALLINT
			DECLARE @ACTION_REMARK VARCHAR(400)
			DECLARE @BA_ACCOUNT_BALANCE_ID UNSIGNED BIGINT
			--DECLARE @END_DAY_BOO CHAR(1)
			DECLARE @LAST_UPD DATETIME
			DECLARE @LAST_UPD_BY VARCHAR(50)
			
			--for BA_ACCOUNT_BALANCE_ID
			DECLARE @BA_NO VARCHAR(30)
			
			WHILE @MAX_LOOP >= @COUNT_LOOP
				BEGIN
					--set value
					SET ROWCOUNT @COUNT_LOOP
					
					--set value
					select @TREATMENT_ID = TREATMENT_ID, @BA_NO = BA_NO, @ACTION_STATUS = ACTION_STATUS, @ACTION_REMARK = ACTION_REMARK, @LAST_UPD = LAST_UPD, @LAST_UPD_BY = LAST_UPD_BY from inserted

					--check end day
					--IF (select count(1) from dbo.CL_TREATMENT_STATUS where TREATMENT_ID = @TREATMENT_ID and CREATED > CONVERT(DATETIME, CURRENT_DATE())) > 0
					--	BEGIN
					--		select @END_DAY_BOO = 'N'
					--	END
					--ELSE
					--	BEGIN
					--		select @END_DAY_BOO = 'Y'
					--	END
					
					select @BA_ACCOUNT_BALANCE_ID = BA_ACCOUNT_BALANCE_ID from CL_HIS_BA_ACCOUNT_BALANCE where BA_NO = @BA_NO and CURRENT_BOO = 'Y'
								
					if(@LAST_UPD_BY is null or @LAST_UPD is null)
						begin
							select @LAST_UPD_BY = CREATED_BY, @LAST_UPD = CREATED from inserted
						end
					
					--change RECORD INFO
					UPDATE dbo.CL_TREATMENT_STATUS SET RECORD_END_DTM = DATEADD(ss, -1, @LAST_UPD) , CURRENT_BOO = 'N' WHERE RECORD_END_DTM IS NULL AND CURRENT_BOO = 'Y' AND TREATMENT_ID = @TREATMENT_ID 
					
					--insert to CL_TREATMENT_STATUS
					insert into dbo.CL_TREATMENT_STATUS (TREATMENT_ID, ACTION_STATUS, ACTION_REMARK, RECORD_START_DTM, CURRENT_BOO, BA_ACCOUNT_BALANCE_ID, CREATED, CREATED_BY, LAST_UPD, LAST_UPD_BY) 
					values (@TREATMENT_ID, @ACTION_STATUS, @ACTION_REMARK, @LAST_UPD, 'Y', @BA_ACCOUNT_BALANCE_ID, @LAST_UPD, @LAST_UPD_BY, @LAST_UPD, @LAST_UPD_BY) 
					
					select @COUNT_LOOP = @COUNT_LOOP + 1
				END
			END
GO

